import React from 'react';
import { Link } from 'react-router-dom';

function Layout(props) {
  return (
    <div className="layout">
      <header>
        <nav>
            <ul>
                <li>
                    <Link to="/">Inicio</Link>
                </li>
                <li>
                    <Link to="/">Registro</Link>
                </li>
            </ul>
        </nav>
    
      </header>
      <main>
        {props.children}
      </main>
      <footer>
        <h4>Contacto</h4>
      </footer>
    </div>
  );
}
